import{initializeGUI}from"../utility/initialize_gui.js";window.handleCredentialResponse=function(i){i=i.credential;fetch("/api/api/verifyIdToken",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({idToken:i})}).then(i=>i.json()).then(i=>{!0===i.loginSuccess&&(console.log("Login was successful"),initializeGUI())}).catch(i=>{console.error("Error verifying ID token:",i)})};